import React from 'react'

const MyjobsComponents = ({jobs}) => {

  return (
    <div>
      {jobs ? jobs?.map(job => {
        return <div>
            <h1>{job?.title}</h1>
            
        </div>
      } ) : ''}
    </div>
  )
}

export default MyjobsComponents
